import React from 'react';
import './Title.css';
import Colton from '../../images/colton.jpeg';

const Title = () => {
    return(
              <div className="vh-50 dt w-100 tc title">
                <div className="dtc v-mid">
                  <div class="pt5 tc">
                      <img
                          src={Colton}
                          class="br4 h5 w5 " alt="avatar" />
                  </div>
                  <h1 className=" black fw3 font">COLTON WILLIAMS</h1>
                </div>
              </div>

 );
}

export default Title;
